  const [question, setQuestion] = useState("");

  useEffect(() => {
    fetch("http://localhost:5000/?question=4&id=1X6qxNWpj31C3wFc-T_8yeLlsZKsUYimvHtKaG6hJ8QU").then(response =>
      response.json().then(data => {
        setQuestion(data[0]);
      })
    );
  }, [])

  console.log(question);

  return (
    <div className="App">
      <p>{question}</p>
    </div>
  );
}

export default App;
